  false,\n\t\"url\": null,\n\t\"notes\": \"In FY2014, the MTA also upgraded its bus
  ridership counting system to enhance its service planning and scheduling functions.
  This new Automatic Passenger Count (APC) system uses computerized sensors to count
  passengers as they board and leave the vehicle. The APCs provide the most accurate
  estimates of bus ridership to date and the most robust data for ridership on particular
  routes, which will help drive planning decisions. In order to maintain the integrity
  of historical comparisons for the Transit Ridership Goal, the MTA used ridership
  estimate differences between the new APC system and previous counting estimates
  for its Bus Service to allow for apples-to-apples comparisons between fiscal years.\",\n\t\"license_title\":
